import React from "react";
import axios from "axios";
export default class App extends React.Component {
    state = {
       users: []
    };
    componentDidMount() {
       this.getUsers();
    }
    getUsers = () => {
       axios
           .get('http://127.0.0.1:8000/prodotti')
           .then(data => this.setState({ users: data.data.data }), console.log(users))
           .catch(err => {
               console.log(err);
               return null;
           });
    };
    render() {
       return (
           <div>
               {this.state.users.length === 0 ? (
                   <div>Loading...</div>
               ) : (
                   this.state.users.map((e, i) => {
                       return <div key={i}>{e.first_name}</div>;
                    })
               )}
           </div>
       );
     }
}
